// Define a function to convert markdown text to HTML
std::string markdownToHtml(const std::string& markdownText) {
    // Define the rules for parsing markdown
    std::string rules = "\\s*(.*)\\s*";
    std::string match;
    std::string capture;

    // Use regular expressions to match the rules
    while ((match = std::regex_search(markdownText, rules)) != std::string::npos) {
        // Extract the matched groups
        std::string group1 = match[1];
        std::string group2 = match[2];

        // Replace the matched groups with HTML tags
        if (group1 == "\\s*") {
            match[1] = "<span>" + group2 + "</span>";
        } else if (group1 == "\\s*") {
            match[1] = "<a>" + group2 + "</a>";
        }
    }

    // Replace any remaining markdown text with HTML tags
    std::string htmlText = markdownText;
    std::string tag;
    while ((tag = std::regex_search(htmlText, "\\s*")) != std::string::npos) {
        htmlText = htmlText.replace(tag[1], "<" + tag[1] + ">");
    }

    // Remove any leading spaces
    htmlText.pop_back();
    htmlText.pop_back();

    return htmlText;
}

