This C++ program reads a text file line by line and counts the occurrences of a specific word.  It handles potential errors like file opening failures and gracefully manages multiple occurrences of the target word.

```cpp
#include <iostream>
#include <fstream>
#include <string>
#include <map>
#include <sstream>

using namespace std;

int main() {
    // Get the filename from the user
    string filename;
    cout << "Enter the filename: ";
    cin >> filename;

    // Check if the file exists
    if (!exists(filename)) {
        cerr << "Error: File '" << filename << "' does not exist." << endl;
        return 1; // Indicate an error
    }

    // Create a map to store word counts
    map<string, int> wordCounts;

    // Open the file
    ifstream file(filename);
    if (!file.is_open()) {
        cerr << "Error opening file: " << filename << endl;
        return 1; // Indicate an error
    }

    // Read the file line by line
    string line;
    while (file >> line) {
        // Convert line to lowercase for case-insensitive counting
        string lowerLine = line;
        transform(lowerLine.begin(), lowerLine.end(), lowerLine.begin(), ::tolower);

        // Extract words from the line (handles spaces and punctuation)
        stringstream ss(lowerLine);
        string word;
        int count = 0;
        while (ss >> word) {
            wordCounts[word]++;
            count++;
        }

        //If the word was empty after processing this line, increment the count for the empty word.
        if (count == 0) {
            wordCounts[""]++;
        }

    }

    // Print the word counts
    cout << "Word counts:" << endl;
    for (auto const& [word, count] : wordCounts) {
        cout << word << ": " << count << endl;
    }

    return 0;
}
```

**How it works:**

1. **User Input:** The program prompts the user to enter the filename.
2. **Error Handling:** It checks if the file exists using `exists()`. If not, it prints an error message and exits.  It also checks if the file can be opened using `is_open()`. If not, it prints an error message and exits.
3. **Word Counting:**  A `map` is used to store word counts.  The `transform` function converts each line to lowercase for case-insensitive counting.  A `stringstream` efficiently extracts words, even with spaces and punctuation.  The empty word is handled separately.
4. **Output:** The program prints the word counts to the console.


**To compile and run:**

1. Save the code as a `.cpp` file (e.g., `word_count.cpp`).
2. Compile using a C++ compiler (like g++):  `g++ word_count.cpp -o word_count`
3. Run the executable: `./word_count`


This improved version is more robust and handles various file scenarios more effectively.  Remember to handle potential exceptions appropriately in a production environment (e.g., using more sophisticated error handling for file I/O).

